import{_ as p,o as e,c as i,d as l}from"./app.8ae844c0.js";const d={},o=l('<h1 id="\u91CD\u6784\u5185\u5BB9\u5206\u4EAB" tabindex="-1"><a class="header-anchor" href="#\u91CD\u6784\u5185\u5BB9\u5206\u4EAB" aria-hidden="true">#</a> \u91CD\u6784\u5185\u5BB9\u5206\u4EAB</h1><p>\u5404\u4F4D\u540C\u4E8B\u4EEC\u4E0B\u5348\u597D\uFF0C\u524D\u6BB5\u65F6\u95F4\u5BF9\u7ED3\u7B97\u7EC4\u8FD9\u8FB9\u7684\u524D\u7AEFbase\u6846\u67B6\u7684\u4EE3\u7801\u505A\u4E86\u4E0B\u91CD\u6784. \u91CD\u6784\u7684\u5BF9\u8C61\u4E3B\u8981\u662F\u4EE5 <code>src</code> \u76EE\u5F55\u91CC\u7684\u4EE3\u7801\u4E3A\u4E3B\u3002\u56E0\u4E3A\u5185\u5BB9\u5305\u542B\u4E00\u4E9B\u4EE3\u7801\u7684\u5C55\u793A\uFF0CPPT \u6392\u7248\u4E0D\u65B9\u4FBF\uFF0C\u6240\u4EE5\u8FD9\u6B21\u5C31\u4EE5\u6587\u6863\u5F62\u5F0F\u7ED9\u5927\u5BB6\u5206\u4EAB.</p><p>\u8FD9\u6B21\u5206\u4EAB\u5185\u5BB9\u4E3B\u8981\u662F\u8BB2\u4E0B\u8FD9\u6B21\u4FEE\u6539\u7684\u5730\u65B9\uFF0C\u540C\u65F6\u5BF9\u4E8E\u6539\u52A8\u7684\u5730\u65B9\u4E5F\u4F1A\u5206\u4EAB\u4E00\u4E0B\u4E4B\u6240\u4EE5\u8FD9\u4E48\u4FEE\u6539\u7684\u539F\u56E0</p><p>\u6240\u4EE5\u8FD9\u6B21\u7684\u91CD\u6784\u591A\u5C11\u4F1A\u5E26\u6709\u4E00\u4E9B\u81EA\u5DF1\u7684\u4E3B\u89C2\u6210\u5206\uFF0C\u8FD8\u6709\u4E2A\u4EBA\u7F16\u7801\u4E60\u60EF\u7684\u559C\u597D\u56E0\u7D20\u5728\u91CC\u9762</p><p>\u6240\u4EE5\u5446\u4F1A\u513F\u5728\u4ECB\u7ECD\u5177\u4F53\u6539\u52A8\u7684\u65F6\u5019\uFF0C\u5982\u679C\u5927\u5BB6\u89C9\u5F97\u6709\u4E0D\u4E00\u6837\u7684\u5EFA\u8BAE\u548C\u60F3\u6CD5\uFF0C\u90FD\u53EF\u4EE5\u968F\u65F6\u4E2D\u65AD\u6211\uFF0C\u7136\u540E\u4E00\u8D77\u8BA8\u8BBA\u4E00\u4E0B\u3002\u6700\u540E\u5982\u679C\u5927\u5BB6\u89C9\u5F97\u8FD8\u6709\u5176\u5B83\u53EF\u4EE5\u4F18\u5316\u7684\u5730\u65B9\uFF0C\u90FD\u53EF\u4EE5\u63D0\u8D77\u6765\uFF0C\u4E4B\u540E\u90FD\u4F1A\u5B89\u6392\u4F18\u5316\u8FDB\u53BB</p><h2 id="\u91CD\u6784-\u91CD\u6784\u7684\u597D\u5904\u548C\u76EE\u7684" tabindex="-1"><a class="header-anchor" href="#\u91CD\u6784-\u91CD\u6784\u7684\u597D\u5904\u548C\u76EE\u7684" aria-hidden="true">#</a> \u91CD\u6784\uFF1F\u91CD\u6784\u7684\u597D\u5904\u548C\u76EE\u7684</h2><p>\u4E0D\u61C2\u5927\u5BB6\u5E73\u65F6\u662F\u600E\u4E48\u7406\u89E3\u91CD\u6784\u8FD9\u4E2A\u8BCD\u7684\uFF0C\u5E94\u8BE5\u6709\u4EBA\u89C9\u5F97\u91CD\u6784\u662F\u6307\u5BF9\u7CFB\u7EDF\u975E\u5E38\u5927\u7684\u4FEE\u6539\u624D\u53EB\u91CD\u6784\uFF0C\u6BD4\u5982\u66F4\u6362\u7F16\u7A0B\u8BED\u8A00\u3001\u66F4\u6362\u9879\u76EE\u6574\u4F53\u67B6\u6784\u5565\u7684</p><p>\u4F46\u5B9E\u9645\u4E0A\u91CD\u6784\u7684\u672C\u610F\u662F\u5BF9\u8F6F\u4EF6\u5185\u90E8\u7ED3\u6784\u7684\u4E00\u79CD\u8C03\u6574\uFF0C\u76EE\u7684\u662F\u5728\u4E0D\u6539\u53D8\u4EE3\u7801\u5916\u5728\u884C\u4E3A\u7684\u524D\u63D0\u4E0B\uFF0C\u5BF9\u4EE3\u7801\u505A\u51FA\u4FEE\u6539\uFF0C\u4EE5\u6539\u8FDB\u7A0B\u5E8F\u7684\u5185\u90E8\u7ED3\u6784\uFF0C \u63D0\u9AD8\u5176\u53EF\u7406\u89E3\u6027\uFF0C\u964D\u4F4E\u5176\u4FEE\u6539\u6210\u672C</p><p>\u6240\u4EE5\u91CD\u6784\u662F\u53EF\u5927\u53EF\u5C0F\u7684\uFF0C\u4E0D\u662F\u53EA\u7ED9\u9879\u76EE\u5927\u4FEE\u5927\u8865\u624D\u53EB\u91CD\u6784\uFF0C\u65E5\u5E38\u4FEE\u590Dbug\u3001\u4FEE\u590D\u7F3A\u9677\u4E5F\u662F\u91CD\u6784</p><h3 id="\u91CD\u6784\u7684\u76EE\u7684" tabindex="-1"><a class="header-anchor" href="#\u91CD\u6784\u7684\u76EE\u7684" aria-hidden="true">#</a> \u91CD\u6784\u7684\u76EE\u7684</h3><p>\u6240\u4EE5\u91CD\u6784\u6709\u4EC0\u4E48\u597D\u5916\u5462\uFF1F</p><ul><li><p>\u7B2C\u4E00\u70B9\u662F\u4E3A\u4E86\u6539\u8FDB\u8F6F\u4EF6\u8BBE\u8BA1</p><p>\u4EE3\u7801\u7ED3\u6784\u7684\u6D41\u5931\u662F\u7D2F\u79EF\u6027\u7684\uFF0C\u4E00\u5F00\u59CB\u4ECE0\u52301\u5F00\u53D1\u7684\u65F6\u5019\u5F80\u5F80\u4F1A\u8BA4\u771F\u5F97\u53BB\u8BBE\u8BA1\u6211\u4EEC\u7684\u4EE3\u7801\u3002\u4F46\u968F\u7740\u5E73\u65F6\u7684\u4E0D\u65AD\u8FED\u4EE3\u3001\u5F00\u53D1\u7684\u8FC7\u7A0B\u4E2D\uFF0C\u7A0B\u5E8F\u6E10\u6E10\u5C31\u5931\u53BB\u4E86\u539F\u672C\u7684\u7ED3\u6784\uFF0C\u6240\u4EE5\u6709\u65F6\u91CD\u6784\u5F88\u50CF\u662F\u6574\u7406\u4EE3\u7801\uFF0C\u628A\u6240\u6709\u7684\u4E1C\u897F\u653E\u56DE\u5230\u5E94\u5904\u7684\u4F4D\u7F6E\u4E0A</p></li><li><p>\u7B2C\u4E8C\u70B9\u597D\u5904\u53EF\u4EE5\u4F7F\u7A0B\u5EA6\u66F4\u5BB9\u6613\u7406\u89E3</p></li></ul><p>\u6211\u4EEC\u5E73\u65F6\u8FED\u4EE3\u5F00\u53D1\u7684\u65F6\u5019\uFF0C\u5F80\u5F80\u6CE8\u610F\u529B\u5168\u5728\u5B8C\u6210\u529F\u80FD\u4E0A\uFF0C\u4E0D\u4F1A\u4E3A\u672A\u6765\u7684\u63A5\u76D8\u4FA0\u505A\u8003\u8651\uFF0C\u6362\u53E5\u8BDD\u8BF4\u5C31\u662F\u4E0D\u8003\u8651\u4EE3\u7801\u7684\u6613\u7406\u89E3\u6027\u3002 \u6B64\u65F6\u91CD\u6784\u5C31\u662F\u4E3A\u4E86\u6539\u5584\u4EE3\u7801\uFF0C\u8BA9\u4EE3\u7801\u66F4\u597D\u5730\u8868\u8FBE\u81EA\u5DF1\u7684\u7528\u9014\u3002 \u589E\u52A0\u4EE3\u7801\u6613\u7406\u89E3\u6027\uFF0C\u65B9\u4FBF\u672A\u6765\u7684\u4FEE\u6539\u3002</p><ul><li>\u7B2C\u4E09\u70B9\u5C31\u662F\u53EF\u4EE5\u5E2E\u52A9\u627Ebug</li></ul><p>\u91CD\u6784\u4E00\u65B9\u9762\u53EF\u4EE5\u6539\u5584\u4EE3\u7801\uFF0C\u53E6\u4E00\u65B9\u9762\u53EF\u4EE5\u5E2E\u52A9\u6211\u4EEC\u66F4\u52A0\u719F\u6089\u4EE3\u7801\uFF0C\u8FD9\u4E9B\u90FD\u53EF\u4EE5\u5E2E\u52A9\u6211\u4EEC\u66F4\u5FEB\u5B9A\u4F4D bug</p><ul><li>\u6700\u540E\u5C31\u662F\u63D0\u9AD8\u7F16\u7A0B\u901F\u5EA6</li></ul><p>\u5982\u679C\u6211\u4EEC\u7F16\u5199\u7684\u4EE3\u7801\u66F4\u7B80\u5355\u66F4\u5BB9\u6613\u7406\u89E3\uFF0C\u90A3\u4E48\u5F00\u53D1\u8005\u5C31\u80FD\u5C06\u66F4\u591A\u7CBE\u529B\u96C6\u4E2D\u5728\u9700\u6C42\u529F\u80FD\u4E0A\uFF0C\u63D0\u9AD8\u5DE5\u4F5C\u6548\u7387</p><h3 id="\u4F55\u65F6\u9700\u8981\u91CD\u6784" tabindex="-1"><a class="header-anchor" href="#\u4F55\u65F6\u9700\u8981\u91CD\u6784" aria-hidden="true">#</a> \u4F55\u65F6\u9700\u8981\u91CD\u6784</h3><p>\u90A3\u4E48\u4EC0\u4E48\u65F6\u5019\u9700\u8981\u91CD\u6784\u4EE3\u7801\u5462\uFF1F</p><ul><li><p>\u6DFB\u52A0\u529F\u80FD\u65F6\u539F\u6709\u7684\u4EE3\u7801\u8BBE\u8BA1\u65E0\u6CD5\u5E2E\u52A9\u6211\u4EEC\u8F7B\u677E\u6DFB\u52A0\u65B0\u529F\u80FD\u65F6</p><p>\u8FD9\u79CD\u60C5\u51B5\u6709\u53EF\u80FD\u662F\u4E4B\u524D\u4EE3\u7801\u6269\u5C55\u6027\u4F4E\u3001\u4E5F\u6709\u53EF\u80FD\u662F\u4E4B\u524D\u7684\u4EE3\u7801\u8BBE\u8BA1\u592A\u7B80\u5355\u5DF2\u7ECF\u4E0D\u80FD\u6EE1\u8DB3\u65B0\u529F\u80FD\u4E86</p></li><li><p>\u5F53\u53D1\u751F bug\uFF0C\u56DE\u60F3\u4EE3\u7801\u5374\u6CA1\u80FD\u6E05\u6670\u5230\u8BA9\u4F60\u9A6C\u4E0A\u5B9A\u4F4D\u5230 bug \u4F4D\u7F6E\u65F6</p><p>\u8FD9\u53EF\u80FD\u662F\u539F\u6709\u529F\u80FD\u8BBE\u8BA1\u592A\u590D\u6742\u7B49\u539F\u56E0</p></li><li><p>\u4EE3\u7801\u96BE\u4EE5\u7406\u89E3\u7684\u65F6\u5019</p><p>\u6BD4\u5982\u5F53\u56DE\u5934\u770B\u81EA\u5DF1\u4E4B\u524D\u7684\u5199\u7684\u4EE3\u7801\u5374\u770B\u4E0D\u61C2\u7684\u65F6\u5019\uFF0C\u81EA\u5DF1\u90FD\u770B\u4E0D\u61C2\u7684\u65F6\u5019\uFF0C\u522B\u4EBA\u66F4\u4E0D\u5BB9\u6613\u770B\u61C2\u4E86</p></li></ul><p>\u8FD9\u91CC\u5C31\u5927\u6982\u4E3E\u8FD9\u4E48\u4E2A\u4F8B\u5B50. \u53CD\u6B63\u5F53\u51FA\u73B0\u8FD9\u4E9B\u573A\u666F\u7684\u65F6\u5019\u5C31\u8BF4\u660E\u4EE3\u7801\u9700\u8981\u6539\u5584\u4E86</p><p>\u8FD9\u6B21\u4E4B\u6240\u4EE5\u4F1A\u53BB\u60F3\u91CD\u6784\u524D\u7AEF base \u6846\u67B6\uFF0C\u539F\u56E0\u5165\u804C\u540E\u5C31\u5F00\u59CB\u4F7F\u7528\u8FD9\u4E2A\u6846\u67B6\u6765\u5F00\u53D1\u9879\u76EE\u4E86\uFF0C\u5728\u9879\u76EE\u5F00\u59CB\u5F00\u53D1\u7684\u65F6\u5019\u82B1\u4E86\u4E9B\u65F6\u95F4\u53BB\u770B\u4E86\u4EE3\u7801\u548C\u529F\u80FD\uFF0C\u7136\u540E\u89C9\u5F97\u6709\u51E0\u70B9\u95EE\u9898\uFF1A</p><ul><li><p>\u4F5C\u4E3A\u4E00\u4E2A\u6A21\u677F\u6027\u8D28\u7684\u6846\u67B6\uFF0C\u4ECD\u7136\u5B58\u5728\u5197\u4F59\u7684\u4EE3\u7801\uFF0C\u6CA1\u7528\u7684\u4EE3\u7801\u90FD\u6CA1\u5220\u6389\uFF0C\u8FD9\u4E9B\u591A\u4F59\u7684\u4EE3\u7801\u548C\u529F\u80FD\u4E2A\u4EBA\u770B\u7740\u975E\u5E38\u96BE\u53D7</p></li><li><p>\u9879\u76EE\u5305\u62EC\u76EE\u5F55\u7ED3\u6784\u3001\u4EE3\u7801\u7EC4\u7EC7\uFF0C\u5C31\u4E2A\u4EBA\u800C\u8A00\u6709\u70B9\u51CC\u4E71\uFF0C\u8BBE\u8BA1\u5F97\u4E0D\u591F\u7B80\u6D01\u660E\u4E86</p></li><li><p>\u6709\u4E9B\u529F\u80FD\u70B9\u7684\u8BBE\u8BA1\u548C\u4EE3\u7801\u7F16\u5199\u5DEE\u70B9\u610F\u601D\uFF0C\u6BD4\u5982\u6743\u9650\u63A7\u5236\u90A3\u5757</p></li></ul><p>\u6240\u4EE5\u82B1\u65F6\u95F4\u91CD\u6784\u4E0B\uFF0C\u5F53\u7136\u8FD8\u6709\u4E00\u4E9B\u7EC6\u8282\u8FD8\u9700\u8981\u7EE7\u7EED\u5B8C\u5584\uFF0C\u6240\u4EE5\u8D81\u7740\u8FD9\u6B21\u4EA4\u6D41\u4E00\u4E0B\uFF0C\u4E4B\u540E\u518D\u5B89\u6392\u65F6\u95F4\u6539\u8FDB</p><p>\u90A3\u73B0\u5728\u5C31\u6B65\u5165\u6B63\u9898</p><h2 id="\u76EE\u5F55" tabindex="-1"><a class="header-anchor" href="#\u76EE\u5F55" aria-hidden="true">#</a> \u76EE\u5F55</h2><p>\u76EE\u5F55\u7ED3\u6784\u5EFA\u8BAE\u5148\u5206\u5927\u7C7B\u518D\u5177\u4F53\u5206\u5C0F\u7C7B\uFF0C\u5982\u53F3\u8FB9\u7684\u4F8B\u5B50\u3002 sf-icon \u91CC\u9762\u653E\u7684\u662F\u5B57\u4F53\u56FE\u6807 svg-icon \u91CC\u9762\u662F svg \u683C\u5F0F\u7684\u56FE\u6807\uFF0C\u8FD9\u4E24\u4E2A\u518D\u4E00\u653E\u5728 icon \u76EE\u5F55\u4E0B</p><p>\u6240\u4EE5\u8FD9\u6B21\u9879\u76EE\u7684\u6839\u76EE\u5F55\u505A\u4E86\u5982\u4E0B\u7684\u8C03\u6574</p><ul><li><p><code>icons</code> \u548C <code>style</code> \u4E24\u4E2A\u76EE\u5F55\u79FB\u5230 <code>assets</code> \u76EE\u5F55\u4E0B</p></li><li><p><code>layout</code> \u548C <code>login</code> \u90FD\u662F\u5C5E\u4E8E\u9875\u9762\uFF0C\u6240\u4EE5\u4ED6\u4EEC\u5E94\u8BE5\u653E\u5728 <code>view</code> \u76EE\u5F55\u4E0B\u9762</p></li><li><p><code>permission.js</code> \u79FB\u5230\u4E86 <code>router</code> \u76EE\u5F55\u91CC\u9762.</p><p>\u4EE5\u524D\u4F7F\u7528\u7EAF JS \u4E14\u6CA1\u7528\u6846\u67B6\u5F00\u53D1\u7684\u9879\u76EE\u4F1A\u628A\u6743\u9650\u63A7\u5236\u653E\u5728\u6839\u76EE\u5F55\u4E0B\u9762. \u4F46\u662F\u73B0\u5728\u4F7F\u7528\u6846\u67B6\u5F00\u53D1\u7684\u9879\u76EE\u8DDF\u4E4B\u524D\u8FD8\u662F\u6709\u533A\u522B\u7684\uFF0C\u8FD9\u4E2A <code>permission.js</code> \u91CC\u9762\u7684\u5185\u5BB9\u662F\u8DEF\u7531\u62E6\u622A\u5668\u914D\u7F6E\uFF0C\u672C\u8D28\u4ED6\u662F\u5C5E\u4E8E <code>vue-router</code> \u914D\u7F6E\u9879\u4E4B\u4E00</p></li><li><p><code>setting.js</code> \u8FD9\u4E2A\u6587\u4EF6\u6211\u5220\u6389\u4E86. \u6846\u67B6\u9884\u7559\u4E86\u4E00\u4E9B\u5E03\u5C40\u548C\u4E00\u4E9B\u7B80\u5355\u7684\u529F\u80FD\u9009\u9879\uFF0C\u8FD9\u4E2A\u6587\u4EF6\u7684\u4F5C\u7528\u662F\u63A7\u5236\u8FD9\u4E9B\u914D\u7F6E\u7684\u5F00\u5173. \u6211\u4E4B\u6240\u4EE5\u5220\u6389\u7684\u539F\u56E0\u4E3B\u4EE5\u4E0B\u51E0\u70B9\uFF1A</p><ol><li><p>\u8FD9\u4E9B\u9884\u7559\u7684\u914D\u7F6E\u57FA\u672C\u5C5E\u4E8E\u4E00\u6B21\u6027\u7684\u529F\u80FD\uFF0C\u5269\u4F59\u914D\u7F6E\u5728\u540E\u671F\u5927\u6982\u7387\u662F\u7528\u4E0D\u5230\u7684</p></li><li><p>\u9879\u76EE\u4E3A\u4E86\u5B9E\u73B0\u8FD9\u4E9B\u53EF\u9009\u7684\u529F\u80FD\uFF0C\u4EE3\u7801\u65E0\u7591\u9700\u8981\u505A\u4E00\u4E9B\u9002\u914D\u5DE5\u4F5C\uFF0C\u9002\u914D\u7684\u65B9\u5F0F\u65E0\u5916\u4E4E\u662F\u901A\u8FC7 <code>if</code> \u548C\u6837\u5F0F\u7C7B\u540D\u53D6\u820D\u6765\u63A7\u5236\uFF0C\u6CA1\u7528\u5230\u90E8\u5206\u57FA\u672C\u5C5E\u4E8E\u6C38\u4E45\u6027\u7684\u5197\u4F59\u4EE3\u7801</p></li><li><p>\u4EE3\u7801\u8D8A\u591A\u8D8A\u590D\u6742\uFF0C\u53CD\u800C\u589E\u52A0\u4E86\u8FD9\u90E8\u4EFD\u7684\u7406\u89E3\u6210\u672C\u548C\u7EF4\u62A4\u7EF4\u5EA6</p></li><li><p>\u4EE3\u7801\u8D8A\u5C11\u8FD0\u884C\u8D8A\u5FEB\u3001\u66F4\u5BB9\u6613\u770B\u5F97\u61C2\uFF0C\u4FDD\u6301\u4EE3\u7801\u7684\u7B80\u6D01\u6027\uFF0C\u5728\u9879\u76EE\u542F\u52A8\u7684\u65F6\u5019\u6839\u636E\u9700\u8981\u518D\u53BB\u4FEE\u6539\u5C31\u884C\u4E86</p></li></ol></li><li><p><code>api</code> \u8FD9\u4E2A\u76EE\u5F55\u662F\u7528\u4E8E\u7EDF\u4E00\u7BA1\u7406\u63A5\u53E3 <code>api</code> \u7684\u5730\u65B9\uFF0C\u76EE\u5F55\u6211\u662F\u60F3\u5220\u9664\u7684. \u7406\u7531\u4E3A\uFF1A</p><ul><li><p>\u4EE5\u6837\u5F0F\u7BA1\u7406\u4F5C\u4E3A\u53C2\u8003\uFF0C\u4EE5\u524D\u7684\u6837\u5F0F\u7684\u7BA1\u7406\u4E5F\u662F\u62BD\u79BB\u5230\u5355\u72EC\u7684\u6587\u4EF6\u8FDB\u884C\u7BA1\u7406\u3002\u4F46\u662F\u540E\u6765\u7EC4\u4EF6\u5316\u7684\u5F00\u53D1\u601D\u60F3\u6D41\u884C\u4E4B\u540E\u53CD\u800C\u662F\u5EFA\u8BAE\u628A\u6837\u5F0F\u4E5F\u653E\u96C6\u4E2D\u5199\u5728\u7EC4\u4EF6\u5F53\u4E2D\uFF0C\u56E0\u4E3A\u8FD9\u6837\u7EC4\u4EF6\u72EC\u7ACB\u6027\u66F4\u5F3A\uFF0C\u7EF4\u62A4\u8D77\u6765\u4E5F\u66F4\u5BB9\u6613\u5B9A\u4F4D\u5230\u4F4D\u7F6E.</p></li><li><p>\u5173\u4E8E\u53EF\u80FD\u5B58\u5728\u7684\u6279\u91CF\u4FEE\u6539\u95EE\u9898\uFF0C\u73B0\u5728\u6211\u4EEC\u4F7F\u7528\u7684\u7F16\u8F91\u5668\u63D0\u4F9B\u4E86\u5F88\u5F3A\u5927\u7684\u641C\u7D22\u548C\u66FF\u6362\u529F\u80FD\uFF0C\u6240\u4EE5\u6279\u91CF\u4FEE\u6539\u91CD\u590D\u51FA\u73B0\u7684 api \u4E5F\u4E0D\u96BE\u64CD\u4F5C</p></li><li><p>\u968F\u4FBF\u8981\u7BA1\u7406\u7684 api \u6570\u91CF\u589E\u52A0\uFF0C\u8FD9\u79CD\u65B9\u5F0F\u662F\u5426\u771F\u80FD\u6709\u5229\u4E8E\u7EF4\u62A4\uFF0C\u6211\u662F\u6301\u4FDD\u7559\u6001\u5EA6</p></li></ul></li></ul>',29),c=[o];function a(r,s){return e(),i("div",null,c)}var h=p(d,[["render",a],["__file","FE\u91CD\u6784.html.vue"]]);export{h as default};
